pragma solidity 0.5.8;

import "@openzeppelin/contracts/token/ERC721/ERC721Full.sol";
contract Land is ERC721Full {

uint public aa=1234;
 uint public postCount = 0;
     
       
   
    
     uint[] public landno;  //for storing land


  mapping(uint => Citizen) public posts;
   mapping(uint => bool) landminted; // for checking the minting staus of land(minted or not)
    mapping (uint => bool) services;
     //mapping (string => bool) checkvalues;
      mapping (uint => bool) availables;
       mapping (uint=> bool) waterrs;
        mapping (uint => bool) eleccs;
         mapping (uint => bool) loanns;
    
    mapping(uint => address) private landOwner;
 //   mapping(string => address) private adhaarno;

 //mapping citizen to his land
  //  mapping(address => Citizen) citizens;
   // address[] public citizendetail;


    struct Citizen {
        
        string adhaarno;
        string fname;
        string lname;
        uint tokenid;
        address owner;
        bool water;
        bool bank;
        bool elec;
        bool avail;
        
    }
    
event PostCreated(
        string adhaarno,
        string fname,
        string lname,
        uint tokenid,
        address owner,
         bool water,
        bool bank,
        bool elec,
        bool avail

         );



    constructor() ERC721Full("landno","Land") public {

        }





//To get the Details of land owner
/*
function getcitizen(address add) view public returns(string memory,string memory,string memory)
{
    return (citizens[add].adhaarno,citizens[add].fname,citizens[add].lname);
}




*/

// Task of government
function mint(uint mland) public {

   
   require (!landminted[mland]);  //land should not be minted previously
   require (msg.sender==0x917937a261789cf3380021944A1464Fa38586f0e);
   uint no = landno.push(mland); // adds land to the array of minted land
   _mint(msg.sender,no);        //assign land ro the sender of function
    landminted[mland]=true; 

    services[mland]=false;
   //checkvalues[mland]=false;
    availables[mland]=false;
     waterrs[mland]=false;
    eleccs[mland]=false;
    loanns[mland]=false;

    landOwner[mland]=msg.sender;    // assigns true value so that it cannot be minted again
    
}
     


//Government assigning land to their particular owner based on their adhaar card


function govtransfer(address to, uint  tokenId,string memory no,string memory name,string  memory lnamee) public{
require (landminted[tokenId]);
require (msg.sender==0x917937a261789cf3380021944A1464Fa38586f0e);
//require (services[tokenId]);


landOwner[tokenId]=to;
//adhaarno[madhaar]=to;
 //Citizen storage citizen = citizens[to];
if(postCount<tokenId)
{
  postCount=tokenId;
}
  //  citizendetail.push(to) -1;
    posts[tokenId] =  Citizen(no,name,lnamee,tokenId,to,false,false,false,false);
 emit PostCreated(no,name,lnamee,tokenId,to,false,false,false,false);
}


//this function will specify the current owner of the land
  
 // function ownerOf(string memory tokenId/*,string memory madhaar*/) public view returns(string memory,string memory,string memory)   {
 
       // address owner = landOwner[tokenId];
       // address ownera =adhaarno[madhaar];
      //  require(owner != address(0), "ERC721: owner query for nonexistent token");
      //  require (ownera==owner);
       // return getcitizen(owner);
  //  }


 function owner(uint  tokenId/*,string memory madhaar*/) public view returns(address)   {
 
        address owner1 = landOwner[tokenId];
       // address ownera =adhaarno[madhaar];
      //  require(owner1 != address(0), "ERC721: owner query for nonexistent token");
      //  require (ownera==owner);
        return owner1;
    }


    // this function will transfer the land frond one owner to the another
   



    //conformation of all services
   
   
   

 function isavailable(uint  tokenId,bool valid)  public{
   

   require (msg.sender==owner(tokenId));
 Citizen memory _post = posts[tokenId];
          
     
          
            
         if(valid)
          {
      
           availables[tokenId] = true;
           _post.avail=true;
       }
       else
       {
       availables[tokenId] = false;
     _post.avail=false;
       }
      
       
      
         
    }
     
       
    
    
        
      
     function waterbill(uint tokenId,bool valid) public
   {
            require (msg.sender==0x48E93E9ad94ea0AAd209aBe5BC879040447aCE98);
       Citizen memory _post = posts[tokenId];
           
       
         if(valid)
          {
      
             waterrs[tokenId] = true;
             _post.water=true;
       }
       else
       {
       waterrs[tokenId] = false;
        _post.water=false;
       }
      
       
    }
    
     function electric(uint  tokenId,bool valid) 
    public
   {
          require (msg.sender==0x48E93E9ad94ea0AAd209aBe5BC879040447aCE98);
       
              Citizen memory _post = posts[tokenId];
       
         if(valid)
          {
      
            eleccs[tokenId] = true;
            _post.elec=true;
       }
       else
       {
       eleccs[tokenId] = false;
        _post.elec=false;
       }
      
    }
    
     function loan(uint  tokenId,bool valid)  public
    {
          require (msg.sender==0x48E93E9ad94ea0AAd209aBe5BC879040447aCE98);
         Citizen memory _post = posts[tokenId];
      
           
         if(valid)
          {
      
             loanns[tokenId] = true;
             _post.bank=true;
       }
       else
       {
        loanns[tokenId] = false;
         _post.bank=false;
       }
      

    }
     

function isallclear(uint  tokenId) public {
    



    if(availables[tokenId] || waterrs[tokenId] || eleccs[tokenId] || loanns[tokenId] )
        {
        
        services[tokenId]=true;
       
        }
    }


     function transfer(address from, address to,uint tokenId,string memory no,string memory fname,string memory lname) public {

        require(msg.sender==owner(tokenId));

      require (services[tokenId]);
        
        landOwner[tokenId]=to;
          Citizen memory _post = posts[tokenId];
          _post.owner=to;
           _post.fname=fname;
            _post.lname=lname;
             _post.adhaarno=no;

          posts[tokenId]=_post;
 services[tokenId]=false;
   //checkvalues[mland]=false;
    availables[tokenId]=false;
    waterrs[tokenId]=false;
    eleccs[tokenId]=false;
    loanns[tokenId]=false;
         emit PostCreated(_post.adhaarno,_post.fname,_post.lname,_post.tokenid,_post.owner,false,false,false,false);
    }
}
